import React from "react";
import { Container, Row } from "react-bootstrap";
import "./Sales.css";

function Sales() {
  return (
    <Container className="contain_sales">
      <div className="sales_title">
        <h3 className="sharp">Buy! Sharp TOKUNBO Cars from the USA </h3>
      </div>
      <br />
      <br />
      <div className="first_grid">
        <div className="first_g1"></div>
        <div className="first_g2"></div>
        <div className="first_g3"></div>
      </div>
      <br />
      <div className="car_info"></div>
      <div className="more_car"></div>

      <div className="second_grid">
        <div className="second_g1"></div>
        <div className="second_g1"></div>
        <div className="second_g3"></div>
      </div>
      <div className="car_info"></div>
      <div className="more_car"></div>
    </Container>
  );
}

export default Sales;
